resources.string:
Signaturversionen für Android-Versionen:
V1 - die erste Signaturoption, die einzige bis Android 7.0;
V2 - hinzugefügt zu Android 7.0;

Die Signaturversion sollte basierend auf der für die Anwendung erforderlichen Mindest-/Zielversion von Android verwendet werden. Wenn die Zielversion 30+ (Android 11+) ist, ist die V2-Signatur erforderlich.

Wenn du das Kontrollkästchen "Speichern" nicht aktivierst, werden die ausgewählten Schemata nur dieses Mal verwendet.

Signaturversionen für Android-Versionen:
V1 - die erste Signaturoption, die einzige bis Android 7.0;
V2 - hinzugefügt zu Android 7.0;
V3 - hinzugefügt zu Android 9.0;
V4 - hinzugefügt zu Android 11;

Die Signaturversion sollte basierend auf der für die Anwendung erforderlichen Mindest-/Zielversion von Android verwendet werden. Wenn die Zielversion 30+ ist (Android 11+), ist die V2-Signatur erforderlich. V2 oder V3 müssen zusammen mit der V4-Signatur verwendet werden. Die Version V4 wird derzeit so gut wie nie verwendet.

Wenn du das Kontrollkästchen "Speichern" nicht aktivierst, werden die ausgewählten Schemata nur dieses eine Mal verwendet.
